import React from 'react';
import './Navbar.css';
import logo from '../../Assets/logo.png';

const Navbar = () => {
    return (
        <nav className='navbar'>
            <img src='{logo} a'/>

            <div className='desktopMenu'>

            </div>
            <button className='desktopMenuBTN'>
                <img src='' alt='' className='desktopMenuIMG' />Contact Me
            </button>
        </nav>
    )
}

export default Navbar;
